rce`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"658880","type":"CustomJS"},{"attributes":{"overlay":{"id":"658757"}},"id":"658752","type":"BoxZoomTool"},{"attributes":{"below":[{"id":"658833"}],"center":[{"id":"658836"},{"id":"658840"},{"id":"658874"}],"height":90,"left":[{"id":"658837"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"658861"}],"sizing_mode":"stretch_width","title":{"id":"658863"},"toolbar":{"id":"658849"},"toolbar_location":null,"width":null,"x_range":{"id":"658496"},"x_scale":{"id":"658829"},"y_range":{"id":"658827"},"y_scale":{"id":"658831"}},"id":"658825","subtype":"Figure","type":"Plot"},{"attributes":{"source":{"id":"658529"}},"id":"658802","type":"CDSView"},{"attributes":{"source":{"id":"658530"}},"id":"658727","type":"CDSView"},{"attributes":{"factors":["0","1"],"palette":["tomato","lime"]},"id":"658531","type":"CategoricalColorMapper"},{"attributes":{"axis":{"id":"658549"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"658552","type":"Grid"},{"attributes":{},"id":"658812","type":"BasicTickFormatter"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"658580"}],"tooltips":[["Date","@datetime{%c}"],["Equity","@equity{+0,0.[000]%}"]]},"id":"658582","type":"
